        //// DFA 1.0
        //    //"<style type=\"text/css\">.feed-description-container td {border: 1pt #dddddd solid;padding: 3pt 7.5pt 3pt 4.5pt;text-align: left;}.feed-description-container .separator {background-color: #DBDBDB;}.feed-description-container table {background-color: white;border-collapse: collapse;margin: 0 auto;border: 1px solid #ccc;}.feed-description-container img {max-width: 100%;}.left{float:left}.right {float:right}.feed-description-title-buttoned{overflow:auto}</style><div ng-controller='tabsController'><uib-tabset active=\"active\" class=\"feed-description-container\">{{active}}<uib-tab index=\"0\" heading=\"Feed Overview\"><h2>Feed Overview</h2><p>The DoubleClick – Event Level feed offers full cookie level impressions, clicks, and activities logs from Google's Data Transfer 1.0 product. In 2016, Google will be discontinuing Data Transfer 1.0 and replacing it with a new 2.0 integration. Networks will be required to upgrade to the new version of the feed, but can still acquire historical data through the 1.0 integration indefinitely.</p><p>For more information on the DoubleClick – Event Level feed, please review the documentation in the following tabs and Google’s Data Transfer documentation: <a target=\"_blank\" href=\"https://support.google.com/dcm/partner/answer/165589?hl=en&amp;ref_topic=6107470\">https://support.google.com/dcm/partner/answer/165589?hl=en&amp;ref_topic=6107470</a></p></uib-tab><uib-tab index=\"1\" heading=\"Opt-In Process\"><h2>Opt-In Process</h2><p>In order to begin using this feed, a one-time opt-in process is required for new networks. To start the opt-in process, you must already have <a target=\"_blank\" href=\"https://support.google.com/dcm/partner/answer/165589?hl=en\">DCM Data Transfer</a> enabled for your network. If setup, please follow the below steps to begin the flow of this event level data into our Data Marketplace:</p><ul><li><p>Grant Google Cloud bucket access to data.support@groupm.com by taking the following steps:</p><ul><li><a target=\"_blank\" href=\"https://groups.google.com\">Login</a> to your Google Group account</li><li>Click on “My Groups”</li><li>Find the group you wish to grant access to and click on the “Manage” link below the group name. Note: You must be an owner of the Google Group in order to share access. You will not see a “Manage” link if you are only a member (non-admin) of this group. You must contact the bucket owner to grant access in this case.</li><li>Select “Invite Members” on the left navigation</li><li>Enter data.support@groupm.com in the email address field and then click “Send Invite”</li></ul></li></br><li><p>Grant <a target=\"_blank\" href=\"https://www.google.com/dfa/trafficking/\">DCM portal</a> access to data.support@groupm.com. This step is optional, but highly recommended as this enables us to automate daily validations of the log file data against the DCM API. Networks who opt to skip this step will not have their data validated daily and will be responsible for performing their own validations on the data. Instructions on how to grant access are as follows:</p><ul><li>Create a new user profile: Click Admin &gt; User profiles &gt; New user profile. If you are unable to create a user profile, you do not have admin rights and must contact your account administrator</li><li>Enter data.support@groupm.com in the email address field</li><li>Assign a role. This role should have all reporting access options enabled.</li><li>On the filter tab, select all advertisers. Note: This is recommended so that DCM portal access does not need to be manually modified each time a new advertiser is created.</li></ul></li></br><li><p>Once completed, send an email to <a href=\"mailto:datavault.support@groupm.com\">datavault.support@groupm.com</a> with the following details about your client and Google Cloud bucket:</p><ul><li>DCM Network Name</li><li>DCM Network ID</li><li>Agency</li><liD>ata Center where the client data should be stored. Our available Data Centers are:<ul><li>North America (North Virginia)</li><li>EMEA (Frankfurt)</li><li>APAC (Singapore)</li></ul></li><li>Market that your client operates in</li><li>Google Cloud Bucket URL (example: <a target=\"_blank\" href=\"https://console.developers.google.com/storage/browser/dfa_-a006191fa538e950x07255372b241ca2ea75432b\">https://console.developers.google.com/storage/browser/dfa_-a006191fa538e950x07255372b241ca2ea75432b</a>)</li><li>The inception date for which you would like the feed to collect data. Note that this date cannot be set to an earlier date than data is available in the bucket.</li></ul></li></ul><p>Please note that all of the above information is required in a single email in order to begin the opt-in process. Once all information is received, please allow 2-3 business days for the opt-in setup process. For large networks or advertisers requiring large historical backfills, please allow additional time.</p><p>If your client does not have Data Transfer enabled or if you are unsure, please contact your agency’s Google representative or Uzo Ometu (<a href=\"mailto:uzo@google.com\">uzo@google.com</a>) for more details. We also advise that if you setup Data Transfer for a new network, you must use the Thorn (þ) delimiter with gzip compression to ensure compatibility with our Data Marketplace feed. Please note that the Google Data Transfer setup process typically takes 5-7 business days, so be sure to allow for additional time. Based on your region, Google may also require a signed SOW or may charge an additional fee.</p><p>Once your network has been successfully opted-in, our support team will contact you with an update. You may then request access to the data in order to being using it.</p></uib-tab><uib-tab index=\"2\" heading=\"Pricing\"><h2>Pricing</h2><p>There is no cost to use the DoubleClick – Event level feed; however, depending on your market Google may charge an additional fee to enable their Data Transfer product. Any applicable costs must be managed and negotiated by the agency directly with Google. The pricing information for Google’s Data Transfer is as follows:</p><ul><li>North America: Data Transfer is free of charge for all GroupM clients</li><li>UK: Data Transfer is free of charge for all GroupM clients</li><li>All other regions: Market specific rates apply. Please contact your local Google representative for pricing.</li></ul></uib-tab><uib-tab index=\"3\" heading=\"Data Dictionary\"><div class=\"feed-description-title-buttoned\"><h2 class=\"left\">Data Dictionary</h2><h2 class=\"right\"><a href=\"\" class=\"btn\">Download as Excel</a></h2></div><table><tr><td><p><b><span>TableName</span></b></p></td><td><p><b><span>TableType</span></b></p></td><td><p><b><span>ColumnName</span></b></p></td><td><p><b><span>PrimaryKey</span></b></p></td><td><p><b><span>IsNullable</span></b></p></td><td><p><b><span>DataType</span></b></p></td><td><p><b><span>Length</span></b></p></td><td><p><b><span>Definition</span></b></p></td></tr><tr><td><p><span>activity</span></p></td><td><p><span>fact</span></p></td><td><p><span>activity_time</span></p></td><td><p><span>&nbsp;</span></p></td><td><p><span>no</span></p></td><td><p><span>timestamp</span></p></td><td><p><span>&nbsp;</span></p></td><td><p><span>Displays the local event time in 24-hour format. Format: MM-DD-YYYY-24HH:MI:SS</span></p></td></tr><tr><td><p><span>activity</span></p></td><td><p><span>fact</span></p></td><td><p><span>user_id</span></p></td><td><p><span>&nbsp;</span></p></td><td><p><span>yes</span></p></td><td><p><span>varchar</span></p></td><td><p><span>50</span></p></td><td><p><span>The DoubleClick cookie ID. Or if the browser does not accept cookies or the user has &quot;opted-out&quot;, a zero (0) is provided.</span></p></td></tr><tr><td><p><span>activity</span></p></td><td><p><span>fact</span></p></td><td><p><span>advertiser_id</span></p></td><td><p><span>&nbsp;</span></p></td><td><p><span>yes</span></p></td><td><p><span>integer</span></p></td><td><p><span>&nbs