        //// MEDIALETS
        //    //"<style type=\"text/css\">.feed-description-container td {border: 1pt #dddddd solid;padding: 3pt 7.5pt 3pt 4.5pt;text-align: left;}.feed-description-container .separator {background-color: #DBDBDB;}.feed-description-container table {background-color: white; border-collapse: collapse; margin: 0 auto; border: 1px solid #ccc;}.feed-description-container img {max-width:100%;}</style><uib-tabset active=\"active\" class=\"feed-description-container\"><uib-tab index=\"0\" heading=\"Feed Overview\"><p>The Medialets - Event Level integration provides full impression,  click, and conversion activities logs from the Medialets mobile ad server. Note that device graph traversal data is not  available, but will be included in a separate Medialets feed in the future. This is a global feed that supports  advertisers in all markets. A one-time  opt-in process is required to initiate usage for new advertisers.</p><p><strong>Opt-In Protocol:</strong></p><p>In order to  begin using this feed, a one-time opt-in process is required for new advertisers. To opt-in, please email<a href=\"mailto:datavault.support@groupm.com\">datavault.support@groupm.com</a> and  provide the agency, region, country, Advertiser ID and Advertiser Brand ID  associated with your advertiser.</p><p><strong>Data Settling Window:</strong></p><p>The data for Medialets does not use a setting window, so the data does not change  historically; therefore all new data can be appended to the prior day’s data.</p></uib-tab><uib-tab index=\"1\" heading=\"Data Dictionary\"><h2>Fact Tables</h2><h3>Standard Delivery</h3><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"80%\"><tbody><tr><td valign=\"middle\"><p><strong><span>Field Name</span></strong></p></td><td valign=\"middle\"><p><strong><span>Data Type</span></strong></p></td><td valign=\"middle\"><p><strong><span>Constraints</span></strong></p></td><td valign=\"middle\"><p><strong><span>isNullable</span></strong></p></td><td valign=\"middle\"><p><strong><span>Field Description</span></strong><strong><span> </span></strong></p></td></tr><tr><td valign=\"middle\"><p><span>EventTime</span></p></td><td valign=\"middle\"><p><span>DATETIME</span></p></td><td valign=\"middle\"><p><span>&nbsp;PK</span></p></td><td valign=\"middle\"><p><span>FALSE</span></p></td><td valign=\"middle\"><p><span>Time of impression.</span></p></td></tr><tr><td valign=\"middle\"><p><span>AdID</span></p></td><td valign=\"middle\"><p><span>VARCHAR(100)</span></p></td><td valign=\"middle\"><p><span>&nbsp;PK</span></p></td><td valign=\"middle\"><p><span>FALSE</span></p></td><td valign=\"middle\"><p><span>Unique advertisement ID from Medialets.</span></p></td></tr><tr><td valign=\"middle\"><p><span>Environment</span></p></td><td valign=\"middle\"><p><span>VARCHAR(50)</span></p></td><td valign=\"middle\"><p><span>&nbsp;</span></p></td><td valign=\"middle\"><p><span>FALSE</span></p></td><td valign=\"middle\"><p><span>Impression environment. app or mobile web.</span></p></td></tr><tr><td valign=\"middle\"><p><span>CreativeVersionID</span></p></td><td valign=\"middle\"><p><span>INT</span></p></td><td valign=\"middle\"><p><span>&nbsp;</span></p></td><td valign=\"middle\"><p><span>FALSE</span></p></td><td valign=\"middle\"><p><span>Creative version id served for this impression</span></p></td></tr><tr><td valign=\"middle\"><p><span>ImpID</span></p></td><td valign=\"middle\"><p><span>VARCHAR(300)</span></p></td><td valign=\"middle\"><p><span>&nbsp;PK</span></p></td><td valign=\"middle\"><p><span>FALSE</span></p></td><td valign=\"middle\"><p><span>Unique impression ID from Medialets.</span></p></td></tr><tr><td valign=\"middle\"><p><span>isImpression</span></p></td><td valign=\"middle\"><p><span>INT</span></p></td><td valign=\"middle\"><p><span>&nbsp;</span></p></td><td valign=\"middle\"><p><span>FALSE</span></p></td><td valign=\"middle\"><p><span>Value of 1 for all impressions except click-only trackers. Value of 0 for  click-only trackers.</span